By default, will use the ASP.NET Membership Provider (http://msdn.microsoft.com/en-us/library/yh26yfzy(v=VS.100).aspx). But you can modify and extend this behavior in either or both of the following ways: - Pass your own IMembershipProvider to the BasicAuthenticationMessageHandler constructor - Set the GetAdditionalClaims property to a Func that returns a collection of System.Security.Claims.Claim objects
To configure the authentication, place the following line somewhere in your startup code - e.g. the Register() method in /app_start/WebApiConfig.cs:
GlobalConfiguration.Configuration.MessageHandlers.Add(new BasicAuthenticationMessageHandler());
